import * as React from 'react';
import { ImageList, ImageListItem } from '@mui/material';

import image1 from '../../assets/img/app_design/Group 1284@3x.png';
import image2 from '../../assets/img/app_design/Group 1285@3x.png';
import image3 from '../../assets/img/app_design/Group 1286@3x.png';
import image4 from '../../assets/img/app_design/Group 1287@3x.png';





const app_design = () => {
  return (
    <ImageList sx={{ width: 500, height: 450 }}>
      <ImageListItem key="Subheader" cols={2}>
        <ListSubheader component="div">""</ListSubheader>
      </ImageListItem>
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}?w=248&fit=crop&auto=format`}
            srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
          <ImageListItemBar
            title={item.title}
            subtitle={item.author}
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

const itemData = [
  {
    img: {image1},
    title: 'Copodeals',
    author: '12345',
    rows: 2,
    cols: 2,
    featured: true,
  },
  {
    img: {image2},
    title: 'coloniume',
    author: '12345',
  },
  {
    img: {image3},
    title: 'sixteen89',
    author: '12345',
  },
  {
    img: {image4},
    title: 'Coffee',
    author: '12345',
    cols: 2,
  },
  {
    img: {image4},
    title: 'Coffee',
    author: '12345',
    cols: 2,
  },
  {
    img: {image4},
    title: 'Coffee',
    author: '12345',
    cols: 2,
  },

 
]

export default app_design;
